window.bookSummaryJSON = "<p><b>Lexi never expected Cole to return, but when she learns he must leave again, she agrees to go with him.</b></p> <p>Back in the Gloaming, she discovers Cole will stop at nothing to become king, despite opposition from the dark fae who don’t want him to rule.</p> <p>Cole never wanted the role of king - now he has no choice. It’s either survive the trials and claim his father’s throne…or perish. Unfortunately, his strengths as a half fae and half lycan have not prepared him for the dangers of the outer realms.</p> <p>Lexi’s fear for Cole’s safety is rivaled only by the consequences of her choices. If he makes it through the trials and takes control of the Gloaming, can their love survive her deadly secret?</p> <p>Return to the Shadow Realms. A world where vampires feast, lycans love deeply, dark fae seduce, witches cast their spells, dragons rule the skies...and treachery lurks around every corner.</p> <p><b>Due to sexual content, violence, and language, this book is recommended for listeners 18+ years of age.</b></p>"; 
